mapper.select:

select 

from FCRMPEND
where FCRMPEND_DATE = #{fcrmpendDate,jdbcType=CHAR}
  and FCRMPEND_TIME = #{fcrmpendTime,jdbcType=CHAR}
  and FCRMPEND_STAN = #{fcrmpendStan,jdbcType=CHAR}

mapper.delete:

delete from FCRMPEND
where FCRMPEND_DATE = #{fcrmpendDate,jdbcType=CHAR}
  and FCRMPEND_TIME = #{fcrmpendTime,jdbcType=CHAR}
  and FCRMPEND_STAN = #{fcrmpendStan,jdbcType=CHAR}
